import axios from "axios";

const API_URL = "/api/company";

const companyAPI = {
  searchCompanies: async (name, tax_id, government_registration_number) => {
    try {
      const searchField = "tax_id"; // Поле для поиска (name, tax_id или government_registration_number)
      const searchValue = "0711058872"; // Значение для поиска

      // Отправка запроса на сервер
      const response = await axios.post("/api/company/searchCompanies", {
        [searchField]: searchValue,
      });
      console.log(response.data);
    } catch (error) {
      console.log("Ошибка при поиске компаний:", error);
      throw error;
    }
  },

  getObjCards: async (companyId, identifiers) => {
    try {
      const response = await axios.post(`${API_URL}/getObjCards`, {
        companies_id: companyId,
        identifiers,
      });
      return response.data;
    } catch (error) {
      console.log("Ошибка при получении карточек объектов:", error);
      throw error;
    }
  },
};

export default companyAPI;
